Full of so much gratitude!🥺🩰🍵✨

Still riding the high from this weekend’s Move with Confidence event with @themovingbodybychristiana 

From mindset shifts to movement, iced oat matchas to heartfelt conversations — what a powerful morning spent with the most beautiful community. We had a full house, and every single soul showed up with openness and warmth. You truly made the energy in the room unforgettable.

Thank you to everyone who joined us, shared your presence, moved your body, and glowed from the inside out. Your energy is what made this event so special.

A huge heartfelt thank you to our incredible brand sponsors who made our gift bags so special. Each product was carefully curated to help our guests continue their confidence journey — and they’re all from brands I already use and love:

